import React from 'react';
import Subscribe from '../Subscribe/Subscribe';
import Footer from '../Footer/Footer';

class Men extends React.Component {
	render() {
		return (
			<React.Fragment>
				<div>Men</div>
		        <Subscribe />
		        <Footer />
      		</React.Fragment>

		)
	}
}

export default Men;
